import React from 'react';
import EditableTable from "./components/EditableTable";

function App() {
  const columns = [
    { field: 'id', fieldName: 'Дата' },
    { field: 'title', fieldName: 'Название' },
    { field: 'lastName', fieldName: 'Автор' },
    { field: 'role', fieldName: 'Место' },
  ];

  const data = [
    { id: 1, title: 'Игра в классики', lastName: 'Хулио Кортасар', role: 'Аргентина' },
    { id: 2, title: 'Генералы песчаных карьеров', lastName: 'Жоржи Амаду', role: 'Бразилия' },
    { id: 3, title: 'Бронзовое крыло', lastName: 'Сестры Чан-Нют', role: 'Вьетнам' },
    { id: 4, title: 'Невероятные похождения Алексиса Зорбаса', lastName: 'Никос Казандзакис', role: 'Греция' },
    { id: 5, title: 'Смилла и ее чувство снега', lastName: 'Питер Хёг', role: 'Дания' },
    { id: 6, title: 'Торжество возвышенного', lastName: 'Нагиб Махфуз', role: 'Египет' },
    { id: 7, title: 'Неправильное воспитание', lastName: 'Абдул Муис', role: 'Индонезия' },
    { id: 8, title: 'Устал рождаться и умирать', lastName: 'Мо Янь', role: 'Китай' },
    { id: 9, title: 'Колодец', lastName: 'Регина Эзера', role: 'Латвия' },
    { id: 10, title: 'Смерть Артемио Круса', lastName: 'Карлос Фуэнтес', role: 'Мексика' },
  ];

  return (
    <>
      <EditableTable columns={columns} rows={data} actions />
    </>
  );
}

export default App;
